  public static PredefinedEncoding GetPredefinedEncoding(string encoding)
  {
    switch (encoding)
    {
      case "m_pdfdocEncoding":
        return PredefinedEncoding.m_pdfdocEncoding;
      case "MacRomanEncoding":
        return PredefinedEncoding.MacRomanEncoding;
      case "WinAnsiEncoding":
        return PredefinedEncoding.WinAnsiEncoding;
      case "StandardEncoding":
        return PredefinedEncoding.StandardEncoding;
      default:
        return (PredefinedEncoding) null;
    }
  }

  static PredefinedEncoding()
  {
    PredefinedEncoding.InitializePdfEncoding();
    PredefinedEncoding.InitializeMacEncoding();
    PredefinedEncoding.InitializeStandardMacEncoding();
    PredefinedEncoding.InitializeWinAnsiEncoding();
  }

  private void Init()
  {
    this.names = new string[256 /*0x0100*/];
    for (int index = 0; index < 256 /*0x0100*/; ++index)
      this.names[index] = ".notdef";
  }

  private void InitMapping()
  {
    if (this.mapping != null)
      return;
    this.mapping = new Dictionary<string, byte>(this.names.Length);
    for (int index = 0; index < this.names.Length; ++index)
    {
      if (this.names[index] != null)
        this.mapping[this.names[index]] = (byte) index;
    }
  }

  public string[] GetNames() => (string[]) this.names.Clone();

  public byte GetCharId(string name) => this.mapping[name];
